                        <option>Trizeps</option>
                        <option>Schultern</option>
                    </select>
                </form> */}
                <div>
                    {exercises.map((exercise) => {
                        <ExerciseContainer
                        key={exercises.id}
                        name={exercises.name}
                        muscle={muscle}
                        type={type}
                        description={description}
                        />
                    })}
                </div>
            </div>
        </Fragment>
     );
}

export default Exercises;
